package org.openl.rules.spring.openapi;

import org.openl.util.StringUtils;
import org.springframework.web.context.request.RequestContextHolder;
import org.springframework.web.context.request.ServletRequestAttributes;

import java.util.Optional;

public final class OpenApiUtils {

    private OpenApiUtils() {

    }

    /**
     * <img src="data:image/png;base64," />
     * @return
     */
    public static String getRequestBasePath() {
        var requestAttrs = RequestContextHolder.getRequestAttributes();
        if (requestAttrs instanceof ServletRequestAttributes) {
            var request = ((ServletRequestAttributes) requestAttrs).getRequest();
            var sb = new StringBuilder(request.getScheme())
                    .append("://")
                    .append(request.getServerName())
                    .append(':')
                    .append(request.getServerPort());
            Optional.of(request.getContextPath())
                    .filter(StringUtils::isNotBlank)
                    .ifPresent(sb::append);
            Optional.of(request.getServletPath())
                    .filter(StringUtils::isNotBlank)
                    .ifPresent(sb::append);
            return sb.toString();
        }
        return null;
    }

}
